import React from "react";

function TextAI() {
  return (
    <div className="textAI">
      <p className="textOneAI">Do You Have An Idea ?</p>
      <p className="textTwoAI">
        Let's validate it with AI, trained with 10000s
        <br />
        of data
      </p>
      <br>
        <br></br>
      </br>
    </div>
  );
}

export default TextAI;
